import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faYoutubeSquare, faQuora, faFreeCodeCamp, faFirefox, faGithubSquare, faMedium, faDev } from "@fortawesome/free-brands-svg-icons";
import { faGlobe } from "@fortawesome/free-solid-svg-icons";

const icons = {
    "youtube" : () =>  (<FontAwesomeIcon icon={faYoutubeSquare} size="lg" />),
    "quora" : () =>  (<FontAwesomeIcon icon={faQuora} size="lg" />),
    "stack-overflow" : () =>  (<FontAwesomeIcon icon={faStackOverflow} size="lg" />),
    "free-code-camp" : () =>  (<FontAwesomeIcon icon={faFreeCodeCamp} size="lg" />),
    "globe" : () =>  (<FontAwesomeIcon icon={faGlobe} size="lg" />),
    "firefox" : () =>  (<FontAwesomeIcon icon={faFirefox} size="lg" />),
    "github" : () =>  (<FontAwesomeIcon icon={faGithubSquare} size="lg" />),
    "medium" : () =>  (<FontAwesomeIcon icon={faMedium} size="lg" />),
    "dev" : () =>  (<FontAwesomeIcon icon={faDev} size="lg" />),
}

export default {
    getIcon : (site) => icons[site]
}
